import React from 'react'
export default class DataEntry extends React.Component {
    render() {
        return (
            <tr>
                <td>{item.date}</td>
                <td>${item.revenue}</td>
                <td>{item.adRequest}</td>
                <td>{item.adResponse}</td>
                <td>{item.impressions}</td>
                <td>{item.clicks}</td>
                <td>{Math.trunc((item.impressions / item.adResponse) * 100)}%</td>
            </tr>
        )
    }
}
